import logo from './logo.svg';
import './App.css';
import Todo from './Component/Todo';
import UserInfo from './Component/UserInfo';
import Login from './Component/Login';
import {BrowserRouter,Route,Switch} from 'react-router-dom'
import SignUp from './Component/SignUp';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <div>
          <Switch>
            <Route path='/listform'>
              <Todo></Todo>
            </Route>
            <Route path='/userlist'>
              <UserInfo></UserInfo>
            </Route>
            <Route path='/login'>
              <Login></Login>
            </Route>
            <Route path='/signup'>
             <SignUp></SignUp>
            </Route>
          </Switch>
        </div>
      </BrowserRouter>

    </div>
  );
}

export default App;
